import React from 'react';
import Countdown from 'react-countdown';

const renderer = ({ minutes, seconds }) => {
  return (
    <span>
      {minutes}:{seconds}
    </span>
  );
};
const Timer = () => {
  return (
    <div>
      <Countdown date={Date.now() + 90000} renderer={renderer} />
    </div>
  );
};

export default Timer;
